import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App" >
      <fieldset>
        <form>
          <h1>Form Pembelian Buah</h1>
          <input type="text" id="nama">Nama Pelanggan</input>
        </form>
      </fieldset>
    </div>
  );
}

export default App;
